const refreshInterval = setInterval(() => {
  // Only refresh if we're still on the dashboard page
  if (variables['a2567b97-2e78-488d-b60d-75f8eb253e2d'] === 'dashboard') {
    console.log('Auto-refreshing dashboard data');

    // Here you would typically make API calls to refresh the data
    // For this example, we'll just simulate a refresh by toggling loading states briefly

    variables['is_loading_charts'] = true;

    setTimeout(() => {
      variables['is_loading_charts'] = false;

      // Simulate data updates
      const currentAlerts = [...variables['ff56a115-d492-4780-b189-4971ce2ca29d']];
      if (Math.random() > 0.7) {
        // Occasionally add a new alert
        const alertTypes = ['service', 'fuel', 'system'];
        const randomType = alertTypes[Math.floor(Math.random() * alertTypes.length)];
        const messages = {
          'service': 'Vehicle ' + ['ABC123', 'XYZ789', 'DEF456'][Math.floor(Math.random() * 3)] + ' due for service',
          'fuel': 'Vehicle ' + ['ABC123', 'XYZ789', 'DEF456'][Math.floor(Math.random() * 3)] + ' low on fuel',
          'system': 'System update required'
        };

        currentAlerts.unshift({
          id: Date.now().toString(),
          type: randomType,
          message: messages[randomType],
          timestamp: new Date().toISOString()
        });

        variables['ff56a115-d492-4780-b189-4971ce2ca29d'] = currentAlerts;
        variables['0e5a180e-2fd0-48f9-ab52-0aaa89330676'] += 1;
      }
    }, 800);
  }
}, 15000);

// Clean up interval when page is unloaded
return () => {
  clearInterval(refreshInterval);
  console.log('Dashboard refresh interval cleared');
};

